import logo from './logo.svg';
import './App.css';
import navBar from './components/navBar';
import Counters from './components/counters'

function App() {

      state = { 
        counters:[
            {id: 1, value: 1},
            {id: 2, value: 2},
            {id: 3, value: 3},
            {id: 4, value: 4},
        ]
     }
  return (
    <div className="App">
      <navBar/>
      <Counters/>
    </div>
  );
}

export default App;
